import React, {Component} from 'react';
import Header from './header';
import Call_action from './call_action';
import Footer from './footer';

class Home extends Component{
    render(){
       
        return(
            <div className="about_page">
                <div className="wellcom_banner">
                    <Header />
                </div>
                <div className="about_wrap">
                    <div className="container">
                        <h3>Trading rules</h3>
                        <p>1. After entering  uberDex, log in by Scatter. (How to use Scatter please click how to use scatter?)</p>
                        <p>2. Click on 'Trading Center' to enter the quotes page and select the currency you want to trade. For example, if you want to buy SYS, you can click SYS/EOS to enter the transaction page.</p>
                        <p>3. At the bottom of the page, you can choose to trade at a limit or market price. If you choose a limit trade, that is, a pending trade, enter your trade price and the number of trades, choose to buy or sell, and when the market price fluctuates to the price you set, you can automatically close the trade.</p>
                        <p>4. If you choose a market price transaction, click on 'Market Price Transaction' and enter the quantity you want to buy or sell. The system will trade at the current market price.</p>
                    </div>
                </div>
                <Call_action />
                <Footer />
            </div>
        )
    }
}

export default Home;
